import React, { useContext } from 'react';
import { motion, AnimatePresence } from 'framer-motion';

// context
import { AppContext } from '../App';

const toastAnim = {
  hidden: {
    top: '30%',
    left: '-100vh',
    transition: {
      duration: 0.1,
    },
  },
  visible: {
    left: 10,
    transition: {
      duration: 0.1,
    },
  },
};

const Toast = () => {
  // get toast message from context
  const { toast } = useContext(AppContext);

  return (
    <AnimatePresence>
      <motion.div
        className="fixed p-2 mx-2 lg:mx-0 rounded text-sm lg:text-base max-w-screen-sm bg-gray-800 font-bold text-primary-100 flex items-center justify-between"
        variants={toastAnim}
        initial="hidden"
        animate="visible"
        exit="hidden">
        <img
          src={`data:image/png;base64,`}
          style={{ width: '30px', marginRight: '10px' }}
          alt="Kingsport logo"
        />
        <small className="flex-1">{toast.message}</small>
      </motion.div>
    </AnimatePresence>
  );
};

export default Toast;
